Surya (Nikhil) is a pickpocket and he works with
his gang (Pooja, Chanti) like a professional.   
One incident gets Surya to come across Swathi   
an innocent and cute girl and he falls in love  
with her. But Swathi doesn't know Surya's       
background.Meanwhile, an idol which gets        
stolen from Padmanabhaswamy temple in Kerala    
changes hands and finally lands in the hands    
of Surya. This is being chased by the           
notorious Shankar (Ravi Babu).How that idol     
came to Surya and what happens after that       
forms the rest of the story.                    



